import { MDBContainer, MDBRow } from 'mdbreact'
import React, { Component } from 'react'

export default class Android extends Component {
    render() {
        return (
            <div>
               <div className="android">
                   <MDBContainer>
                      <img src={require('../images/services.jpg')} alt=""/>
                   </MDBContainer>
               </div>
            </div>
        )
    }
}
